import React from 'react'
import { Link } from 'react-scroll'

const Navbar = () => (

    <header className="sans-serif">
        <div className="cover bg-left bg-center-l" style={{ backgroundImage: 'none' }}>
            <div className="bg-black-80 o-10 ">
                <nav className="dt w-100 mw8 center">

                    <div className="dtc v-mid tr pa3">
                        <Link
                            activeClass="active"
                            to="about"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                            className="f4 fw4 hover-darkorange no-underline white-70 dn dib-ns pv2 ph3" >About
                        </Link>
                        <Link
                            activeClass="active"
                            to="projects"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                            className="f4 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" >Project
                        </Link>
                        <Link
                            activeClass="active"
                            to="resume"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                            className="f4 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" >Resume
                        </Link>
                        <Link
                            activeClass="active"
                            to="contact"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                            className="f4 fw4 hover-white no-underline white-70 dn dib-ns pv2 ph3" >Contact
                        </Link>                      
                    </div>
                </nav>
            </div>
        </div>
    </header>
);


export default Navbar;
